import './App.css';
import React from 'react';

function App() {
  const [data, setData] = React.useState(null);

  React.useEffect(()=>{
    fetch("/api/users")
      .then( (res) => res.json )
      .then( (received) => {setData(received.message)})
      .catch( err=>{
        console.log(err)
      })
  }, [])

  return (
    <div className="App">
      <header className="App-header">
        <h1>{data}</h1>
      </header>
    </div>
  );
}

export default App;
